class Solution {
    fun lexicographicallySmallestArray(nums: IntArray, limit: Int): IntArray {
        val n = nums.size
        val graph = Array(n) { mutableListOf<Int>() }

        for (i in nums.indices) {
            for (j in i + 1 until n) {
                if (Math.abs(nums[i] - nums[j]) <= limit) {
                    graph[i].add(j)
                    graph[j].add(i)
                }
            }
        }

        val visited = BooleanArray(n)
        fun dfs(index: Int, indices: MutableList<Int>) {
            visited[index] = true
            indices.add(index)
            for (neighbor in graph[index]) {
                if (!visited[neighbor]) {
                    dfs(neighbor, indices)
                }
            }
        }

        for (i in nums.indices) {
            if (!visited[i]) {
                val indices = mutableListOf<Int>()
                dfs(i, indices)
                val values = indices.map { nums[it] }.sorted()
                for ((j, idx) in indices.sorted().withIndex()) {
                    nums[idx] = values[j]
                }
            }
        }
        return nums
    }
}
